    false,nt"url": null,nt"notes": "Streamflow and water quality parameters
    recorded on the West Branch Rock River near Horicon NWR; 2013. Location is Latitude
    43 deg 38' 02", longitude 88 deg 41' 04", in SW 1/4 SW1/4 sec. 35, T.14 N., R.15
    E., Fond Du Lac County, WI, on right bank, 200 feet upstream from HWY 49 bridge
    near Horicon National Wildlife Refuge (NWR). Drainage area of the site is 96.7 square
    miles. Period of record is October 2, 2012 to present. Site is equipped with Sutron
    Satlink in ground level metal gage housing on rock wall, in communication with a
    KPSI submersible pressure transducer mounted on a fencepost in the streambed under
    the bridge. YSI multi-parameter probe is installed in pvc tubing in pool upstream
    of the pressure transducer and metal gage house. Instruments are powered by a solar
    panel run to a battery inside the gage housing. Sutron Satlink transmits stage data
    at 15 minute intervals and water quality data from the YSI sonde every 30 minutes.
    This site is established in cooperation with Horicon National Wildlife Refuge and
